    <h1 key={index}>{targetName}</h1>
  ));
  return (
     <div className="rounded-md p-4 w-1/2  bg-gray-400 m-auto mt-8">
    <div className="flex   justify-center ">
      <h1 className="text-2xl uppercase text-blue-500">print name 1000 times</h1>
      </div>
      <div className=" flex flex-row justify-start w-1/2 ">
         <h1 className="text-lg text-white">{nameElements}</h1>
      </div>


    </div>
  );
}

export default App;
